export const ADD_FILE = 'Add file';
export const ADD_FOLDER = 'Add folder';
export const RENAME = 'Rename';
export const DELETE = 'Delete';

export const ADD = 'add_file';
export const ADDFO = 'add_folder';
export const RNAME = 'rename';
export const DEL = 'delete';

export const alias_to_setter = {
    ADD_FILE: ADD,
    ADD_FOLDER: ADDFO,
    RENAME: RNAME,
    DELETE: DEL
}
